import React from "react";
import { Link } from "react-router-dom";

const Button = ({ text, onClick }) => {
  return (
    <>
      <Link to="/necas">
        <button className="Button" onClick={onClick}>
          {text}
        </button>
      </Link>
    </>
  );
};

Button.defaultProps = {
  text: "Submit",
};
export default Button;
